import "./Footer.css";

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; {new Date().getFullYear()} RGM Trucking. All rights reserved.</p>
      <p>Contact: info@rgmtrucking.com | +91 12345 67890</p>
    </footer>
  );
};

export default Footer;
